import React from 'react';
import ReactDOM from 'react-dom';


function MyInfo(){
  return (
    <div>
      <h1>Geoffrey</h1>
      <p>Je suis un étudiant qui n'a pas de stage</p>
      <ul>
        <li>GridPocket me snobbe</li>
        <li>aucune réponse de la part des autres entreprises</li>
        <li>Même les profs ne donnent plus de nouvelles pour la suite</li>
      </ul>
    </div>
  )
}

ReactDOM.render(
  <MyInfo />,document.getElementById('root')
);
